import React, { Component } from "react";

class Counter extends Component {
   state = {
      count: 0,
   };
   render() {
      // const a = "lalit";

      return (
         <div
            style={{
               marginTop: "200px",
               display: "flex",
               justifyContent: "center",
               flexDirection: "column",
               alignItems: "center",
            }}
         >
            {/* <h3>{a}</h3> */}
            <h3>{this.state.count}</h3>
            <button
   className="cnt"
onClick={() => this.setState({ count: this.state.count + 1 })}
            >
               Update
            </button>
         </div>
      );
   }
}

export default Counter;
